import React,{Component} from 'react';
import Layout from '../Layout/layout'
import Table from '../modules/Table/Table';

class Dreans extends Component{
    render(){
        return(
            <Layout>
                <Table/>
            </Layout>
        )
    }
}

export default Dreans;
